class Generator(GeneratorSSE):
    def generate_main(self):
        bylen = {}
        for code in range(256):
            l3 = (code >> (0*2)) & 0x03
            l2 = (code >> (1*2)) & 0x03
            l1 = (code >> (2*2)) & 0x03
            l0 = (code >> (3*2)) & 0x03
            lengths = [l0, l1, l2, l3]
            if 0 not in lengths:
                inputlen = sum(lengths) + 3
                item = Item()
                item.lengths = lengths
                item.inputlen = inputlen
                if inputlen not in bylen:
                    bylen[inputlen] = [item]
                else:
                    bylen[inputlen].append(item)

        keys = sorted(bylen.keys())
        tmp = {}
        for key in keys:
            values = bylen[key]
            for item in values:
                self.fillup_details(item)
                assert item.hashcode not in tmp
                tmp[item.hashcode] = item

        count = max(tmp)
        self.write("const unsigned max_hash = %d;" % (count,))
        self.write("static const uint8_t patterns[max_hash + 1][20] = {")
        self.indent()
        for byte in range(count + 1):
            pattern     = 20 * [0]
            max_digits  = 0
            hashcode    = 0
            code        = 0
            inputlen    = 0
            if byte in tmp:
                item = tmp[byte]
                max_digits = item.max_digits
                hashcode = item.hashcode
                code = item.code
                inputlen = item.inputlen
                for i, b in enumerate(item.pattern):
                    pattern[i] = b

            pattern[16] = code & 0xff
            pattern[17] = code >> 8
            pattern[18] = inputlen
            pattern[19] = max_digits

            img = ", ".join(map(uint8, pattern))
            self.write("/* %03d */ {%s}," % (byte, img))
        self.unindent()
        self.write("};")

    def fillup_details(self, item):
        item.pattern = self.generate_pshufb_pattern(item.lengths)
        item.max_digits = max(item.lengths)
        item.code = lengths2patterns(item.lengths)

        # 137: ((((1 * len) + (31 * ((code >> 9) & 0xff))) + (3 * ((code >> 2) & 0x3f))) - (19 * ((code >> 8) & 0xff)))
        w0 = (item.code >> 9) & 0xff
        w1 = (item.code >> 2) & 0x3f
        w2 = (item.code >> 8) & 0xff
        k  = item.inputlen

        mul0 = 31
        mul1 =  3
        mul2 = 19
        item.hashcode = k + w0 * mul0 + w1 * mul1 - w2 * mul2


def lengths2patterns(lengths):
    mask = [0]*16
    n = lengths[0]
    mask[n] = 1
    n += lengths[1] + 1
    mask[n] = 1
    n += lengths[2] + 1
    mask[n] = 1
    n += lengths[3] + 1

    img = ''.join('%d' % x for x in reversed(mask))

    return int(img, 2)

def uint8(x):
    if x < 0:
        return "uint8_t(%d)" % x
    else:
        return str(x)


